INSERT INTO "EASY_Widget__c" VALUES(57,'Active','Status: Enrolled','<p style="text-align: center;"><strong style="font-size: 20px; color: rgb(109, 54, 150);">We have received your deposit. Welcome to the University of St. Thomas! </strong></p><p><br></p><p><br></p><p><span style="font-size: 16px;">Watch your email for further information. In the meantime, contact </span><a href="mailto:international@stthomas.edu" target="_blank" style="font-size: 16px;">international@stthomas.edu</a><span style="font-size: 16px;"> with any questions.</span></p><p><br></p><p><span style="font-size: 16px;">F1 students, currently in the USA, should submit the </span><a href="https://www.stthomas.edu/_media-library/_documents/main/20190708-stthomas-international-admissions-SEVIS-form-v1-00.pdf" target="_blank" style="font-size: 16px;">SEVIS transfer form</a><span style="font-size: 16px;">. </span></p><p><br></p><p><br></p><p><br></p><p><strong style="font-size: 16px; color: rgb(109, 54, 150);">Wanting to learn more about St. Thomas?</strong></p><p><span style="font-size: 16px;">Although we cannot host you on campus, we are offering a number of </span><a href="https://www.stthomas.edu/admissions/undergraduate/campus-visits/index.html" target="_blank" style="font-size: 16px;">virtual visits options</a><span style="font-size: 16px;"> to bring campus to you!</span></p><p style="text-align: center;"><br></p><p style="text-align: center;"><br></p><p style="text-align: center;"><strong style="color: rgb(109, 54, 150); font-size: 20px;">Congratulations! We&#39;re so happy you&#39;ve chosen St. Thomas.</strong></p><p style="text-align: center;"><br></p><p style="text-align: center;"></p>','International','ApplicationPortal','Confirmed','','','','Graphic: UG Confirmed INTL (UGFR)','','','','','Content Bottom','Central Daylight Time (America/Chicago)','Custom','13');
