INSERT INTO "EASY_Widget__c" VALUES(61,'Active','Your application is almost complete!','However, it looks like we’re still missing a few things for your application. To find out what you are missing, contact your <a href="https://www.stthomas.edu/admissions/undergraduate/contact/" target="_blank">admissions counselor. </a><br>Please get those items into us soon so we can move your application along and get you another step closer to Tommiehood. ','U.S. Citizen;U.S. Dual Citizen;U.S. Permanent Resident;Asylee/Refugee;Other','ApplicationPortal','Submitted App','','','','Graphic: UG Submitted (UGFR)','','','','','Content Bottom','Central Daylight Time (America/Chicago)','Custom','13');
