INSERT INTO "EASY_Widget__c" VALUES(64,'Active','','<p><strong style="font-size: 18px; color: rgb(109, 54, 150);">Welcome to the First-Year Application!</strong></p><p><br></p><p>Now that you started your application, you’ve taken your first step to becoming a Tommie. We’re pretty excited about that and we hope you are too!  </p><p><br></p><p>Use the Application Portal above to follow the steps to submit your application. For questions, contact your <a href="https://www.stthomas.edu/admissions/undergraduate/contact/" target="_blank">admissions counselor. </a></p>','U.S. Citizen;U.S. Dual Citizen;U.S. Permanent Resident;Asylee/Refugee;Other','ApplicationPortal','Started App','','','','Graphic: UG Started App (UGFR)','','5.0','','','Content Bottom','Central Daylight Time (America/Chicago)','Custom','13');
