INSERT INTO "EASY_Widget__c" VALUES(68,'Active','Status: Enrolled','<p style="text-align: center;"><strong>We have received your deposit. Welcome to the St. Thomas community!</strong></p>

<p> </p>

<p><span style="font-size: 16px;">Now that you’re officially going to be a Tommie, you should join the </span><a href="https://www.facebook.com/groups/692276151644990" style="font-size: 16px;" target="_blank">Class of 2026 Facebook page</a><span style="font-size: 16px;"> so you can connect with your future classmates and friends.</span></p>

<p><br><strong>Financial Aid</strong></p>

<p><span style="font-size: 16px;">If you completed the </span><a href="https://studentaid.gov/h/apply-for-aid/fafsa" style="font-size: 16px;" target="_blank">Free Application for Federal Student Aid</a><span style="font-size: 16px;"> (FAFSA) you will receive a comprehensive financial aid package starting January 15, if we have received your FAFSA.</span></p>

<p><br><strong>Placement Assessment</strong></p>

<p><span style="font-size: 16px;">You may need to complete placement assessments in some subjects. Placement assessments help make sure you register for the right classes when you begin at St. Thomas. The placement assessment process is now open. Visit the </span><a href="https://www.stthomas.edu/guide/placementassessments/" style="font-size: 16px;" target="_blank">assessment website</a><span style="font-size: 16px;"> for more information on how to complete this process. </span></p>

<p> </p>

<p><span style="font-size: 16px;">Visit our </span><a href="https://www.stthomas.edu/admissions/undergraduate/freshman/admitted-students/" style="font-size: 16px;" target="_blank">Admitted Students website</a><span style="font-size: 16px;"> for important upcoming dates and feel free to contact your </span><a href="https://www.stthomas.edu/admissions/undergraduate/contact/locate-counselor" style="font-size: 16px;" target="_blank">admissions counselor</a><span style="font-size: 16px;"> with any questions. </span></p>

<p> </p>

<p> </p>

<p style="text-align: center;"><strong>Congratulations on making your college decision! We&#39;re so happy you&#39;ve chosen St. Thomas! </strong></p>

<p> </p>

<p style="text-align: center;"> </p>','U.S. Citizen;U.S. Dual Citizen;U.S. Permanent Resident;Asylee/Refugee;Other','ApplicationPortal','Confirmed','','','','Graphic: UG Confirmed FR (UGFR)','','','','','Content Bottom','Central Daylight Time (America/Chicago)','Custom','13');
