INSERT INTO "Question__c" VALUES(125,'True','','','','Started App;Submitted App','','','','False','','','Hide','','8.0','False','True','Started App','False','','','','','','','False','Do you plan to discern the priesthood by applying to the Saint John Vianney College Seminary?','','','','SJV Static static (UGTR)','Name','False','','','012P0000002xrgvIAA','','Started App','','','<p><span style="color: rgb(3, 45, 96);">Interested students should speak with their Diocesan vocation director as soon as possible. By selecting “Yes” to this question, you agree that the Office of Admissions may share certain information from your application with Saint John Vianney College Seminary to facilitate the dual application process.</span></p>','','','','254');
