INSERT INTO "Question__c" VALUES(387,'True','','','','','','','','False','','','','','','False','True','','False','','','','','','','False','','','','','Link to UG Apps (UGFR)','Name','False','','','012P0000002xrgvIAA','','','','','<p>You are applying to the University of St. Thomas as an <strong>Undergraduate First-Year </strong>applicant.<br> </p>

<p style="margin-left: 40px;"><em>If you have enrolled in college/university courses after completing high school (or earning your GED), you should apply as a transfer student. Click here to go to the </em><a href="https://easyappdev-uofstthomasmn.cs2.force.com/admissions/ApplicationRegistration?at=UGTR" style="font-size: 16px;" target="_blank"><em> Undergraduate Transfer application.</em></a></p>

<p> </p>

<p style="margin-left: 40px;"><em>Dougherty Family College offers a two-year associate degree designed to propel students towards success and provide a smooth transition to a four-year college. Click here if you would like to apply to the </em><a href="https://easyappdev-uofstthomasmn.cs2.force.com/admissions/ApplicationRegistration?at=DFC" style="font-size: 16px;" target="_blank"><em> Dougherty Family College application. </em></a></p>

<p> </p>

<p><span style="background-color: #ffffff; color: #444444;">Click next to create your password and create your application.</span></p>','','','','301');
