INSERT INTO "Question__c" VALUES(508,'True','','','','Started App;Submitted App','','','','False','','','','','3.0','False','True','Started App','False','','','','','','','False','','','','','Application Changes Consent Text (DFC)','Name','False','','','012P0000002xrgvIAA','','Started App','','','<p><br></p><p><span style="font-size: 15.6px; color: rgb(0, 0, 0);">I understand that once my application has been submitted it may not be altered; I will need to contact the Office of Undergraduate Admissions via email at </span><strong style="font-size: 15.6px; color: rgb(0, 0, 0);">admissions@stthomas.edu</strong><span style="font-size: 15.6px; color: rgb(0, 0, 0);"> to provide additional information or make changes (ex. address change). </span><span style="color: rgb(255, 0, 0); background-color: rgb(255, 255, 255);">*</span></p>','','','','330');
