INSERT INTO "Question__c" VALUES(510,'True','','','','Started App;Submitted App','','','','False','','','','','1.0','False','True','Started App','False','','','','','','','False','','','','','Application Materials Consent Text (DFC)','Name','False','','','012P0000002xrgvIAA','','Started App','','','<p><br></p><p>I have reviewed each page of my application; I certify the information I have provided on this application and all other admission materials is complete, accurate and true to the best of my knowledge. <span style="color: rgb(255, 0, 0);">*</span></p>','','','','330');
INSERT INTO "Question__c" VALUES(511,'True','','','','Started App;Submitted App','','','','False','','','','','10.0','False','True','Started App','False','','','','','','','False','','','','','EOE Statement (DFC)','Name','False','','','012P0000002xrgvIAA','','','','','<p><br></p><p><br></p><p><strong style="color: rgb(81, 35, 115);">The University of St. Thomas is an equal opportunity educator and employer. St. Thomas does not unlawfully discriminate, in any of its programs or activities, on the basis of race, color, creed, religion, national origin, sex, sexual orientation, family status, disability, age, marital status, status with regard to public assistance, membership or activity in a local commission, genetic information or any other characteristic protected by applicable law. </strong><a href="http://www.stthomas.edu/eostatement" target="_blank"><strong>http://www.stthomas.edu/eostatement</strong></a></p><p><br></p><p><strong style="color: rgb(81, 35, 115);">The University of St. Thomas is registered with the Minnesota Office of Higher Education pursuant to sections 136A.61 to 136A.71. Registration is not an endorsement of the institution. Credits earned at the institution may not transfer to all other institutions. Contact information for the Minnesota Office of Higher Education is: 1450 Energy Park Drive, Suite 350 St. Paul, MN 55108-5227 Phone: (651) 642-0567 Toll Free: (800) 657-3866 Fax: (651) 642-0675 </strong><a href="https://www.ohe.state.mn.us/" target="_blank"><strong>https://www.ohe.state.mn.us/</strong></a></p>','','','','330');
INSERT INTO "Question__c" VALUES(512,'True','','','','Started App;Submitted App','','','','False','','','','','20.0','False','True','Started App','False','','','','','','Please type your name in the space above.','False','Student Signature','','','','Student Signature (DFC)','Name','False','','Full Name','012P0000002xrgwIAA','','Started App','','','','','','','330');
INSERT INTO "Question__c" VALUES(513,'True','','','','','','','','False','','','','','5.0','False','True','','False','','','','','','','False','','','','','St Thomas Policies Text (DFC)','Name','False','','','012P0000002xrgvIAA','','Started App','','','<p><br></p><p>I understand that an offer of admission from the University of St. Thomas is contingent upon successful completion of all secondary school coursework and/or college level coursework at a level similar to the work evidenced in the application and the applicant continuing to meet admission standards and expectations, as determined by St. Thomas in its sole discretion. In addition, applicants are expected to comply with the <a href="https://www.stthomas.edu/media/officeofgeneralcounsel/policies/Student-Conduct-Code-and-Non-Academic-Conduct-Procedures.pdf" target="_blank">St. Thomas Student Conduct Code, Convictions</a>, and <a href="https://www.stthomas.edu/officeofgc/universitypolicies/universitypolicyrepository/policiesbyapplicability/" target="_blank">other applicable St. Thomas policies </a>governing student conduct. St. Thomas may rescind its offer of admission or take other action if an applicant or admitted student engages in conduct inconsistent with these expectations. Admitted students must update St. Thomas regarding any material changes in the information submitted during the application process, including academic standing and/or disciplinary history, and must submit a final copy of their secondary school and/or post-secondary transcript for approval prior to matriculation. <span style="color: rgb(255, 0, 0);">*</span></p>','','','','330');
