INSERT INTO "Question__c" VALUES(518,'True','','','','Started App;Submitted App','','','','False','','','','','0.0','False','True','Started App','False','','','','','','','False','The current application is to the Dougherty Family College.','','','','DFC Confirmation (DFC)','Name','True','','','012P0000002xrgvIAA','','','','','<p><span style="color: #032d60;">I recognize that the Dougherty Family College is a selective 2-year college designed to create a supportive pathway to a 4-year (bachelor&#39;s) degree for students with high financial need.</span></p>

<p> </p>

<p><span style="color: #032d60;">I understand that an offer of admission may be conditioned on my ability to demonstrate financial need.</span></p>

<p> </p>

