INSERT INTO "Question__c" VALUES(829,'True','','','','Started App;Submitted App','','','','False','','','','','0.0','False','True','Started App','False','','','','','','','False','Test Score Submission Preference','','','','Test Score Preference Static Text (UGTR)','Name','False','','','012P0000002xrgvIAA','','Started App','','','<p>Students can choose to apply with a standardized test or without. Please let us know if you want test scores to be reviewed as part of your admission application. Wondering which option to choose? View our <a href="https://www.stthomas.edu/admissions/undergraduate/freshman/test-optional/" target="_blank"> test optional website </a> to learn more about our test-optional policies.</p><p><br></p><p>Note: If you have not yet taken the ACT or SAT, but intend to take it and send it as part of your application, select “Apply With Standardized Test”.</p>','','','','226');
