INSERT INTO "Question__c" VALUES(883,'True','','','','Started App;Submitted App','','','','False','','','','','2.0','False','True','Started App','False','','','','','','','False','','','','','Application Materials Consent Text (GSOE)','Name','False','','','012P0000002xrgvIAA','','Started App','','','<p> </p><p>I understand that I have reviewed each page of my application. I certify that the information contained in this application, including all attachments and credentials, is complete and true to the best of my knowledge. I understand that misrepresentation of application information is sufficient grounds for denial of admissions or cancellation of admissions and registration. I understand that all materials received by the University of St. Thomas in connection with this application are not returnable and that the application fee (where applicable) is non-refundable. <span style="color: rgb(255, 0, 0);">*</span></p>','','','','145');
INSERT INTO "Question__c" VALUES(884,'False','','','','Started App;Submitted App','','','','False','','','','','9.0','False','True','Started App','False','','','Apply Without Standardized Test','','','','False','','','','','Test Optional Consent Text (GSOE)','Name','False','','','012P0000002xrgvIAA','','Started App','','','<p><br></p><p>I have chosen to apply as a test-optional applicant. By doing so, I understand that my standardized test scores (even if submitted) will not be considered as part of the admission or merit scholarship review process. I agree to the information the University of St. Thomas has shared about its test optional policy. I understand that if I change my mind and wish to have my test reviewed with my application, I should contact my admissions counselor to discuss my options.</p>','','','','145');
