INSERT INTO "Requirement_Item__c" VALUES(229,'True','False','True','','','','','','1.0','True','True','','','','','','','','','Submitting an essay is a chance to write directly to the committee reviewing your application and it gives you a chance to help us get to know you better. Essays demonstrate your ability to write clearly and concisely on a selected topic and distinguish yourself in your own voice. <i>Essays are recommended, but not required. </i> </br></br>
<b>Essay 2 Topic:</b></br></br>
It is important to St. Thomas that all members of our community understand our dedication to providing an inclusive living and learning environment. <i>We would like to hear your observations and thoughts about diversity and inclusion based on what you have learned in your lifetime.</i></br></br>
<b><i>Please enter your essay in the space provided or upload it using the button below.</i></b></br></br>','','False','False','Essay 2','','Upload Essay 2 (UGTR)','','','012P0000002xrh0IAA','','','','','','','','','Requirement_Item__c2022-05-31 19:01:40Z00000','','','','True','','','5');
INSERT INTO "Requirement_Item__c" VALUES(230,'True','False','True','','','','','','0.0','True','True','','','','','','','','','Submitting an essay is a chance to write directly to the committee reviewing your application and it gives you a chance to help us get to know you better. Essays demonstrate your ability to write clearly and concisely on a selected topic and distinguish yourself in your own voice. <i>Essays are recommended, but not required. </i> </br></br>
You may choose one of the topics described below or submit a paper you have written for class.  </br></br>
<b>Essay 1 Topics:</b></br></br>
1. Discuss a meaningful contribution you have made through involvement in school, church or community activities.</br>
2. Describe an event, a person or an educational experience that has had a major impact on your life and why.</br>
3. Share additional information about your personal story that would be beneficial to the application review process. What do you want the readers to know about you apart from courses, grades and test scores?</br></br>
<b><i>Please enter your essay in the space provided or upload it using the button below.</i></b></br></br>','','False','False','Essay 1','','Upload Essay 1 (UGTR)','','','012P0000002xrh0IAA','','','','','','','','','Requirement_Item__c2022-05-31 19:01:40Z00000','','','','True','','','5');
